import React from 'react';
import Box from '@material-ui/core/Box';
import Container from '@material-ui/core/Container';
import './css/About.css';
import Typography from '@material-ui/core/Typography';
import {withStyles, createStyles} from '@material-ui/styles';
import StyledProps from './StyledProps';

const Contact = (props: StyledProps) => {
  const classes = props.classes;
  return (   
    <Box>
      <Container className={classes.contact} maxWidth={false}>
        <Typography className={classes.text}>This is where links to my gmail, fb, etc will go</Typography>
      </Container>
    </Box> 
  );
}

const useStyles = createStyles({
  contact: {
    display: 'flex',
    flexDirection: 'column',
    backgroundColor: '#8F8073',
    alignItems: 'center',
    padding: '4rem 0',
  },
  text: {
    fontFamily: 'Colombo',
    color: '#12130F',
  },
});

export default withStyles(useStyles)(Contact);
